                CASE
                    WHEN ((c.type)::text = 'income'::text) THEN t.amount
                    ELSE (0)::numeric
                END) AS income_now,
            sum(
                CASE
                    WHEN ((c.type)::text = 'expense'::text) THEN t.amount
                    ELSE (0)::numeric
                END) AS expense_now
           FROM (((public.users u_1
             JOIN public.wallets w ON ((w.user_id = u_1.id)))
             LEFT JOIN public.transactions t ON ((t.wallet_id = w.id)))
             LEFT JOIN public.categories c ON ((c.id = t.category_id)))
          WHERE ((t.transaction_date >= date_trunc('month'::text, (CURRENT_DATE)::timestamp with time zone)) AND (t.transaction_date < date_trunc('month'::text, (CURRENT_DATE + '1 mon'::interval))))
          GROUP BY u_1.id
        ), previous_month AS (
         SELECT u_1.id AS user_id,
            sum(
                CASE
                    WHEN ((c.type)::text = 'income'::text) THEN t.amount
                    ELSE (0)::numeric
                END) AS income_prev,
            sum(
                CASE
                    WHEN ((c.type)::text = 'expense'::text) THEN t.amount
                    ELSE (0)::numeric
                END) AS expense_prev
           FROM (((public.users u_1
             JOIN public.wallets w ON ((w.user_id = u_1.id)))
             LEFT JOIN public.transactions t ON ((t.wallet_id = w.id)))
             LEFT JOIN public.categories c ON ((c.id = t.category_id)))
          WHERE ((t.transaction_date >= date_trunc('month'::text, (CURRENT_DATE - '1 mon'::interval))) AND (t.transaction_date < date_trunc('month'::text, (CURRENT_DATE)::timestamp with time zone)))
          GROUP BY u_1.id
        ), current_balance AS (
         SELECT u_1.id AS user_id,
            sum(w.balance) AS balance_now
           FROM (public.users u_1
             JOIN public.wallets w ON ((w.user_id = u_1.id)))
          GROUP BY u_1.id
        ), previous_balance AS (
         SELECT view_user_wallet_daily_summaries.user_id,
            (((view_user_wallet_daily_summaries.physical + view_user_wallet_daily_summaries.e_wallet) + view_user_wallet_daily_summaries.bank) + view_user_wallet_daily_summaries.others) AS balance_prev
           FROM public.view_user_wallet_daily_summaries
          WHERE (view_user_wallet_daily_summaries.date = ((date_trunc('month'::text, (CURRENT_DATE)::timestamp with time zone) - '1 day'::interval))::date)
        )
 SELECT u.id AS user_id,
    u.name,
    COALESCE(cm.income_now, (0)::numeric) AS income_now,
    COALESCE(cm.expense_now, (0)::numeric) AS expense_now,
    (COALESCE(cm.income_now, (0)::numeric) - COALESCE(cm.expense_now, (0)::numeric)) AS profit_now,
    COALESCE(cb.balance_now, (0)::numeric) AS balance_now,
    round((((COALESCE(cm.income_now, (0)::numeric) - COALESCE(pm.income_prev, (0)::numeric)) / NULLIF(pm.income_prev, (0)::numeric)) * (100)::numeric), 2) AS user_income_growth_percentage,
    round((((COALESCE(cm.expense_now, (0)::numeric) - COALESCE(pm.expense_prev, (0)::numeric)) / NULLIF(pm.expense_prev, (0)::numeric)) * (100)::numeric), 2) AS user_expense_growth_percentage,
    round(((((COALESCE(cm.income_now, (0)::numeric) - COALESCE(cm.expense_now, (0)::numeric)) - (COALESCE(pm.income_prev, (0)::numeric) - COALESCE(pm.expense_prev, (0)::numeric))) / NULLIF((COALESCE(pm.income_prev, (0)::numeric) - COALESCE(pm.expense_prev, (0)::numeric)), (0)::numeric)) * (100)::numeric), 2) AS user_profit_growth_percentage,
    round((((COALESCE(cb.balance_now, (0)::numeric) - COALESCE(pb.balance_prev, (0)::numeric)) / NULLIF(pb.balance_prev, (0)::numeric)) * (100)::numeric), 2) AS user_balance_growth_percentage
